1) Honnou Honey
He can&rsquo;t stop the girls from gossiping&hellip;
The invitation from those gentle eyes is irresistible&hellip;
I want him to love only me&hellip;
I want him to be only with me&hellip;
All the girls are drawn to him&hellip;

The moment he is unable to stop it, he entices more, but he is still far from getting embraced?!

2) Ano Natsu wo Wasurenai (That Unforgettable Summer)
Marie lives in a small town, where most excitement is all about &quot;doing it&quot;. Although at first she feels indifferent about it, it all changed when she reunites with next door neighbour, her &quot;onii-chan&quot; Shinichi...

3) Kimi no Kisu de Oshiete Ageru (Teach Me About Your Kiss)
Miyuki had just broken up with her boyfriend, and meets her next door neighbour, Hayato, who is two years younger than her. She offers to help him study, but it seems she wanted more from him. Since that day, they have an awkward relationship...

4) Toriko ~Toriko~ (Slave ~Captivated~)
Haruna had just been picked up up by an older man called Youji. When he keeps dropping in her doorstep and perhaps starting a relationship, she has suspected something is not quite right about him...

5) Kono Koi ha Himitsu (This Love is a Secret)
She has caught one of her male students shoplifting. In order for her to keep her mouth shut, she had offered for him to stay at her p'ace to keep an eye on him...

6) Atashi ga Heya ni Ageru Riyuu (Give Me Reasons to Go to My Room)

&quot;In this entire world, there is no greater eyesore.&quot;

Shouko and Akki are high school friends who take yandere to the next level: they can only express their feelings through highly stylistic violence.

A complementary story to &quot;Nicochuu&quot;, by the same author.

Kenji and Tama first met on a station platform. Tama's eyes were red from crying after being dumped by his boyfriend and he was curled up like a ball, just like a cat. Under his watchful glare, Kenji actually thought that &quot;love at first sight&quot; really does exist. Even though Kenji falls more and more in love with him every time they meet, Tama still laughs and cries whenever he talks about his ex-boyfriend. Yet, suddenly, he kisses him...

&quot;It's because I like you that I want you to cheer you on.&quot;

&quot;I want you to know that such kindness exists, too.&quot;

&quot;what is happiness?&quot;

The story which follows the adventure of Takeo, the most unfortunate girl of the universe.
Takeo goes to school and lives alone in a inn called Hyakkis&ocirc; (the manor of 100 demons). The life of the young Takao will begin to change the day she sees the youkai...

Ghosts want to be reincarnated, but in order to do so, they&rsquo;ll have to rebel against Hell&rsquo;s rules&hellip;
Upsetting  the balance of Yin and Yang, ghosts begin to band together and form groups, in an attempt to return to the realm of the living.
The leaders of Hell must find these ghosts and return them to the realm they belong to, but there&rsquo;s a problem&hellip;
There aren&rsquo;t enough people for the job! So now, who will take on the role of catching these increasingly powerful and intelligent ghosts?!

On a special occasion of the Christmas Eve, it is a bright night of a city where a clumsy man clad in Santa handing out pocket tissues. There, a lot of stories are unfolding&hellip;

Pt/Br:
Na v&eacute;spera de Natal, &eacute; uma noite brilhante na cidade onde um homem desastrado vestido de Papai Noel vende paninhos de promo&ccedil;&atilde;o. E ent&atilde;o, muitas hist&oacute;rias se entrela&ccedil;am...

Ririka Otsuka is the hottest girl at school and is at the center of every guy's attention. 
&quot;There's no guy out there that doesn't fall for me!&quot; 
Her only secret was that her house was a shabby old table tennis center&hellip;
One day, a transfer student appears before Ririka&mdash;Ageha Hanazono.
Despite his fairy-tale name, he's a super lame and nerdy guy with glasses. Ririka lightheartedly goes and tries to tease Ageha. 
However, Ageha responds with&mdash; 
&quot;I'm already in a committed relationship with table tennis. Therefore I do not intend to engage in an illicit sexual relationship with you.&quot;
How...humiliating! There's actually a guy that doesn't fall for me&mdash;Ririka Otsuka?! Ririka sets up a table tennis match to try and outwit Ageha. 
Once the lame and nerdy pervert (a.k.a. the main character) is given a racket, he flies like a butterfly and dances atop the tables!!

An all new hyper fast table tennis manga&mdash;Love all!!

[b]Included one-shot:[/b] Takujou no Ageha [i](In volume 3, pilot)[/i]
What happens when the cutest girl in school confesses her love to a table tennis fanatic? Gets rejected of course! There's only 1 love in his heart and that's for table tennis. The other sports clubs in school can't stand him getting all the attention and seek to beat him at his own game.

[sub]As a part of the JUMP START initiative, the first three chapters of Takujo no Ageha: The Table Tennis of Ageha were published in English in VIZ Media's digital Weekly Shonen Jump.[/sub]

Linley is a young noble of a declining, once-powerful clan which once dominated the world. He has large aspirations and wants to save his clan. Linley's journey begins with an accident when he discovers a ring. He took a liking to this ring, which had a dragon carved coiling around it. Upon being injured during a battle between two powerful fighters he discovers that his ring is not what he thought it was and possesses powers beyond his imagination.

